    border: "none",
    borderRadius: "6px",
    padding: "6px 12px",
    fontSize: "14px",
    cursor: "pointer",
    transition: "background 0.3s ease, transform 0.2s ease"
  },

  noResult: {
    fontSize: "16px",
    color: "#c0392b",
    marginTop: "12px"
  },

  footer: {
    marginTop: "40px",
    fontSize: "14px",
    color: "#777",
    textAlign: "center"
  }
};
